/* qpsol:(h[48x48,256nz],g[48],a[168x48,780nz],lba[168],uba[168],lbx[48],ubx[48],x0[48],lam_x0[48],lam_a0[168],q[],p[])->(x[48],cost,lam_a[168],lam_x[48]) */
static int casadi_f14(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s22;
  p.sp_h = casadi_s39;
  p.sp_at = casadi_s23;
  p.sp_kkt = casadi_s45;
  p.sp_v = casadi_s46;
  p.sp_r = casadi_s47;
  p.prinv = casadi_s48;
  p.pc =  casadi_s49;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 48, d.lbz);
  } else {
    casadi_fill(d.lbz, 48, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 168, d.lbz+48);
  } else {
    casadi_fill(d.lbz+48, 168, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 48, d.ubz);
  } else {
    casadi_fill(d.ubz, 48, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 168, d.ubz+48);
  } else {
    casadi_fill(d.ubz+48, 168, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 48, d.z);
  } else {
    casadi_clear(d.z, 48);
  }
  casadi_fill(d.z+48, 168, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 48, d.lam);
  } else {
    casadi_clear(d.lam, 48);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 168, d.lam+48);
  } else {
    casadi_clear(d.lam+48, 168);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 48, res[0]);
  if (res[3]) casadi_copy(d.lam, 48, res[3]);
  if (res[2]) casadi_copy(d.lam+48, 168, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

